use tokio::runtime::Runtime;

#[derive(Serialize, Deserialize, Debug)]
struct ElevenLabsResponse {
    audio_url: String,
}

async fn get_audio_url(api_key: &str, text: &str) -> Result<ElevenLabsResponse, Box<dyn Error>> {
    let client = reqwest::Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/tts")
        .bearer_auth(api_key)
        .json(&serde_json::json!({ "text": text }))
        .send()
        .await?;

    let response_data = response.json::<ElevenLabsResponse>().await?;
    Ok(response_data)
}

fn play_audio(audio_url: &str) -> Result<(), Box<dyn Error>> {
    let mut runtime = Runtime::new()?;
    let audio_data = runtime.block_on(async {
        let response = reqwest::get(audio_url).await?;
        response.bytes().await?
    })?;

