import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    if (activeTooltip !== id) {
      closeTooltip();
      openTooltip(id);
    }
  };

