Here is a function that you can use to create a shortcode for displaying a list of custom posts in WordPress. This function allows you to specify the number of posts, a category, and a taxonomy.

```php
function custom_post_shortcode( $atts ) {
    $atts = shortcode_atts(
        array(
            'number' => 5,
            'category' => '',
            'taxonomy' => '',
        ),
        $atts
    );

    $args = array(
        'post_type' => 'your_custom_post_type',
        'posts_per_page' => $atts['number'],
    );

    if ( ! empty( $atts['category'] ) ) {
        $args['category_name'] = $atts['category'];
    }

    if ( ! empty( $atts['taxonomy'] ) ) {
        $args['tax_query'] = array(
            array(
                'taxonomy' => $atts['taxonomy'],
                'field'    => 'slug',
                'terms'    => $atts['category'],
            ),
        );
    }

    $query = new WP_Query( $args );

    if ( $query->have_posts() ) {
        $output = '<ul>';
        while ( $query->have_posts() ) {
            $query->the_post();
            $output .= '<li><a href="' . get_the_permalink() . '">' . get_the_title() . '</a></li>';
        }
        $output .= '</ul>';
    } else {
        $output = 'No posts found';
    }

    wp_reset_postdata();

    return $output;
}
add_shortcode( 'custom_post_list', 'custom_post_shortcode' );
```

Replace `your_custom_post_type` with the name of your custom post type.

