Here's how you can modify the code to use debouncing:

1. First, create a debounce function. This function will take in a function and a delay time as arguments and return a new function that will only call the original function once every delay time.
```javascript
const debounce = (func, delay) => {
  let debounceTimer;
  return function() {
    const context = this;
    const args = arguments;
    clearTimeout(debounceTimer);
    debounceTimer = setTimeout(() => func.apply(context, args), delay);
  }
}
```
