  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (name) => {
  console.log(`Hello, ${name}!`);
  rl.close();
});
```

In this example, `readline.createInterface` is used to create an interface that reads input from `stdin` (standard input) and writes output to `stdout` (standard output). The `rl.question` method is then used to prompt the user for input, and a callback function is provided to handle the input.

When the user enters their name and presses enter, the callback function is called with the user's input as its argument. In this case, the callback function simply logs a greeting to the console and then closes the readline interface.

